import React from 'react';
import HeaderWrapper from '../components/HeaderWrapper';

const styles = {
  profileImage: {
    transform: 'translateY(-60px)',
    border: '5px solid #fff',
    borderRadius: 45,
    marginLeft: 50
  },
  plusImage: {
    height: 40,
    transform: 'translateY(-80px)',
    border: '5px solid #fff',
    borderRadius: 45,
    marginLeft: 30
  },
  profileWrapper: {
    transform: 'translateY(-50px)',
    paddingLeft: 50,
    paddingRight: 50
  }
};

export default function Account() {
  return (
    <div>
      <HeaderWrapper>
        <h1 style={{ letterSpacing: 1.2, marginLeft: 20, marginBottom: 0 }}> Hey, there! </h1>
        <h3 style={{ letterSpacing: 1.2, marginLeft: 20 }}> 12 Jan 2020</h3>
      </HeaderWrapper>
      <img style={styles.profileImage} src={require('../images/profile.jpg')} alt="profile" />
      <img style={styles.plusImage} src={require('../images/plus.png')} alt="profile" />
      <div style={styles.profileWrapper}>
        <h1 style={{ margin: 0 }}> Alec </h1>
        <h1 style={{ margin: 0 }}> Down</h1>
        <p> Profile </p>
        <div>
          <p>Email: alecdown@gmail.com</p>
          <p>Age: 32 </p>
          <p>Points: 15</p>
        </div>
      </div>
    </div>
  );
}
